import { NavLink, Link } from "react-router-dom/cjs/react-router-dom.min";
const Menu = forwardRef(() => {
    const [Open, setOpen] = useState(false);
    useImperativeHandle(ref, () => {
        return{
            toggle : () => setOpen(!Open)
        }
    })
  return (
    <div>Menu</div>
  )
})

export default Menu
